import React from 'react';
import {showForm} from "../../actions";
import {Popup,Button as UiButton, Grid} from 'semantic-ui-react'
function Button({onClick,result}) {
    return (
        <button
            className={'ui button'}
            onClick={onClick}
        >{result}</button>
    )
}

export default Button
